op"}},"id":"1069","type":"Quad"},{"attributes":{"child":{"id":"1401"},"title":"Summary"},"id":"1402","type":"Panel"},{"attributes":{"mantissas":[1,2,5],"max_interval":500.0,"num_minor_ticks":0},"id":"1460","type":"AdaptiveTicker"},{"attributes":{"style":{"border":"1px solid lightgray","box-shadow":"inset 1px 0 8px 0 lightgray","height":"100%","max-height":"1080px","max-width":"1920px","overflow":"auto","padding":"12px","width":"100%"},"text":"\n        &lt;h1&gt; Dask Performance Report &lt;/h1&gt;\n\n        &lt;i&gt; Select different tabs on the top for additional information &lt;/i&gt;\n\n        &lt;h2&gt; Duration: 156.61 s &lt;/h2&gt;\n        &lt;h2&gt; Tasks Information &lt;/h2&gt;\n        &lt;ul&gt;\n         &lt;li&gt; number of tasks: 63 &lt;/li&gt;\n         \n&lt;li&gt; compute time: 78m 28s &lt;/li&gt;\n&lt;li&gt; transfer time: 907.47 ms &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Scheduler Information &lt;/h2&gt;\n        &lt;ul&gt;\n          &lt;li&gt; Address: tcp://10.32.2.35:42183 &lt;/li&gt;\n          &lt;li&gt; Workers: 32 &lt;/li&gt;\n          &lt;li&gt; Threads: 32 &lt;/li&gt;\n          &lt;li&gt; Memory: 298.02 GiB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2022.7.0 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 2022.7.0 &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\nimport os\nimport sys\nimport ROOT\n\nRDataFrame = ROOT.RDF.Experimental.Distributed.Dask.RDataFrame\n\nfrom dask.distributed import Client, SSHCluster\nfrom dask.distributed import performance_report, get_task_stream\nimport dask\n\ndef run_plain_dask(npartitions):\n    def mapper(l):\n        t = ROOT.TTree\n        df = ROOT.RDataFrame\n        h = ROOT.TH1F\n        import time\n        time.sleep(10)\n        return 1\n   \n    def reducer(x, y):\n        return x + y\n    \n    dmapper = dask.delayed(mapper)\n    dreducer = dask.delayed(reducer)\n\n    mergeables_lists = [dmapper(i) for i in range(npartitions)]\n\n    while len(mergeables_lists) &gt; 1:\n        mergeables_lists.append(\n            dreducer(mergeables_lists.pop(0), mergeables_lists.pop(0)))\n\n    final_results = mergeables_lists.pop().persist()\n\n    dask.distributed.progress(final_results)\n    return final_results.compute()\n\ndef createSSHCluster(node, nprocs):\n    scheduler = [node]\n    worker = [node]\n    \n    #print(\"List of nodes: scheduler ({}) and worker ({})\".format(scheduler, worker))\n\n    #cluster = SSHCluster(scheduler + workers, connect_options={ \"known_hosts\": None }, scheduler_options={ 'protocol': 'ucx' }, worker_options={ \"nprocs\" : nprocs, \"nthreads\": 1, \"memory_limit\" : \"10GB\", \"local_directory\" : \"/tmp/etejedor\" })\n    #cluster = SSHCluster(scheduler + workers, connect_options={ \"known_hosts\": None }, worker_options={ \"n_workers\" : nprocs, \"nthreads\": 1, \"memory_limit\" : \"10GB\", \"local_directory\" : \"/tmp/etejedor\" })\n    cluster = SSHCluster(scheduler + worker, connect_options={ \"known_hosts\": None }, worker_options={ \"n_workers\" : nprocs, \"nthreads\": 1, \"memory_limit\" : \"10GB\", \"local_directory\" : \"/tmp/ikabadzh\" })\n    #cluster = SSHCluster(scheduler + workers, connect_options={ \"known_hosts\": None }, worker_options={ \"nprocs\" : 1, \"nthreads\": 1, \"memory_limit\" : \"10GB\", \"local_directory\" : \"/tmp/etejedor\" })\n    #with dask.config.set({\"distributed.worker.resources.process\": 1}):\n    #    cluster = SSHCluster(scheduler + workers, connect_options={ \"known_hosts\": None }, worker_options={ \"nprocs\" : 1, \"nthreads\": 1, \"memory_limit\" : \"300GB\", \"local_directory\" : \"/tmp/etejedor\" })\n    #cluster = SSHCluster(scheduler + workers, connect_options={ \"known_hosts\": None }, worker_options={ \"nprocs\" : 1, \"nthreads\": 32, \"resources\" : { \"process\" : 1 }, \"memory_limit\" : \"10GB\", \"local_directory\" : \"/tmp/etejedor\" })\n    #cluster = SSHCluster(scheduler + workers, connect_options={ \"known_hosts\": None }, worker_options={ \"nprocs\" : 1, \"nthreads\": 1, \"memory_limit\" : \"300GB\", \"local_directory\" : \"/tmp/etejedor\" })\n    #cluster = SSHCluster(['localhost', 'localhost'], connect_options={ \"known_hosts\": None }, scheduler_options={ 'protocol': 'ucx' }, worker_options={ \"nprocs\" : 1, \"nthreads\": 1, \"memory_limit\" : \"300GB\", \"local_directory\" : \"/tmp/etejedor\" })\n    #cluster = SSHCluster(['localhost', 'localhost'], connect_options={ \"known_hosts\": None }, worker_options={ \"nprocs\" : 1, \"nthreads\": 1, \"memory_limit\" : \"300GB\", \"local_directory\" : \"/tmp/etejedor\" })\n    client = Client(cluster)\n    #client.wait_for_workers(len(workers)*32)\n\n    return cluster, client\n\ndef createDataset(num_files):\n    dataset = [\"/hpcscratch/user/ikabadzh/works/BENCHfromNode/input_files/dimuon/f10{}.root\".format(i) for i in range(num_files)]\n    print(\"Dataset with {} files\".format(num_files))\n    return dataset\n\ndef run(dataset, npartitions, client):\n    # Create dataframe from NanoAOD files\n    #files = [ os.path.join(path, data_file) for data_file in dataset ]\n    df = RDataFrame(\"Events\", dataset, npartitions=npartitions, daskclient=client)\n\n    # For simplicity, select only events with exactly two muons and require opposite charge\n    df_2mu = df.Filter(\"nMuon == 2\", \"Events with exactly two muons\")\n    df_os = df_2mu.Filter(\"Muon_charge[0] != Muon_charge[1]\", \"Muons with opposite charge\")\n\n    # Compute invariant mass of the dimuon system\n    df_mass = df_os.Define(\"Dimuon_mass\", \"InvariantMass(Muon_pt, Muon_eta, Muon_phi, Muon_mass)\")\n\n    # Make histogram of dimuon mass spectrum\n    h = df_mass.Histo1D((\"Dimuon_mass\", \"Dimuon_mass\", 30000, 0.25, 300), \"Dimuon_mass\")\n\n    # Produce plot\n    ROOT.gStyle.SetOptStat(0); ROOT.gStyle.SetTextFont(42)\n    c = ROOT.TCanvas(\"c\", \"\", 800, 700)\n    c.SetLogx(); c.SetLogy()\n\n    print(\"About to run loop\")\n    watch = ROOT.TStopwatch()\n    h.SetTitle(\"\")\n    elapsed = watch.RealTime()\n    print(\"\\tEvent loop dimuon_data: {} s\".format(elapsed))\n    h.GetXaxis().SetTitle(\"m_{#mu#mu} (GeV)\"); h.GetXaxis().SetTitleSize(0.04)\n    h.GetYaxis().SetTitle(\"N_{Events}\"); h.GetYaxis().SetTitleSize(0.04)\n    h.Draw()\n\n    label = ROOT.TLatex(); label.SetNDC(True)\n    label.DrawLatex(0.175, 0.740, \"#eta\")\n    label.DrawLatex(0.205, 0.775, \"#rho,#omega\")\n    label.DrawLatex(0.270, 0.740, \"#phi\")\n    label.DrawLatex(0.400, 0.800, \"J/#psi\")\n    label.DrawLatex(0.415, 0.670, \"#psi'\")\n    label.DrawLatex(0.485, 0.700, \"Y(1,2,3S)\")\n    label.DrawLatex(0.755, 0.680, \"Z\")\n    label.SetTextSize(0.040); label.DrawLatex(0.100, 0.920, \"#bf{CMS Open Data}\")\n    label.SetTextSize(0.030); label.DrawLatex(0.630, 0.920, \"#sqrt{s} = 8 TeV, L_{int} = 11.6 fb^{-1}\")\n\n    c.SaveAs(\"dimuon_spectrum.pdf\")\n\nif __name__ == \"__main__\":\n    print(\"IN MAIN\")\n\n    node = sys.argv[1]\n    nprocs = int(sys.argv[2])\n    nfiles = int(sys.argv[3])\n    npartitions = int(sys.argv[4])\n    ntests = int(sys.argv[5])\n\n    cluster, client = createSSHCluster(node, nprocs)\n    print(\"CLUSTER CREATED\")\n    #print(\"WARMUP DONE\")\n    dataset = createDataset(nfiles)\n    #path = '/hpcscratch/user/etejedor/DistRDF_tests/data'\n\n    for i in range(ntests):\n        #with performance_report(filename=\"test.html\"):\n        with performance_report(filename=\"/hpcscratch/user/ikabadzh/distMT2/Alpha/scripts/logs/WORKERS-dask-report{}.html\".format(i)) as pr:\n        #with get_task_stream(plot='save', filename=\"/hpcscratch/user/etejedor/DistRDF_tests/logs/task-stream.html\") as ts:\n            run(dataset, npartitions, client)\n            ##run_plain_dask(npartitions)\n        #print(pr)\n        ##print(ts.data)\n        ##print(ts.figure)\n\n    client.close()\n\n\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{"base":60,"m
